package ui;

import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import java.io.IOException;

import javax.imageio.ImageIO;
import javax.xml.bind.DatatypeConverter;

public class Base64Icons {
	public static final String icon128 = "";
	public static final String icon64 = "";
	public static final String icon48 = "";
	public static final String icon32 = "";
	public static final String icon16 = "";

	public static BufferedImage getIcon(String data) {
		byte[] bytes = DatatypeConverter.parseBase64Binary(data);
		ByteArrayInputStream bin = new ByteArrayInputStream(bytes);
		BufferedImage img = null;
		try {
			img = ImageIO.read(bin);
		} catch (IOException e) {
			e.printStackTrace();
		}
		return img;
	}
}
